import React, { useContext } from 'react';
import StarWarsContext from '../context/StarWarsContext';

function PlanetsTable() {
  const { planets } = useContext(StarWarsContext);

  return planets.length > 0 ? (
    <div>
      <h1>Table</h1>
      <p>
        { planets[0].name }
      </p>
    </div>
  )
    : (<div>Loading...</div>);
}

export default PlanetsTable;
